value:
match let mkloc s e =
        { loc_ghost = false; loc_end = e; Location.loc_start = s } in
      let open MenhirInterpreter in
        let location = mkloc startp endp in
        let closed = ref 0 in
        let unclosed = ref None in
        let return item =
          {
            unexpected;
            shifted;
            popped;
            location;
            unclosed = (!unclosed);
            item
          } in
        let rec process env =
          match top env with
          | None -> return None
          | Some (Element (st, _, startp, endp)) ->
              (if closing_st st then incr closed;
               (match opening_st st with
                | None -> ()
                | Some st ->
                    if ((!closed) = 0) && ((!unclosed) = None)
                    then unclosed := (Some (st, (mkloc startp endp)))
                    else decr closed);
               (match Parser_explain.named_item_at (number st) with
                | name -> return (Some (name, (mkloc startp endp)))
                | exception Not_found ->
                    (match pop env with
                     | None -> return None
                     | Some env -> process env))) in
        process env
with
| { item; unclosed; location; popped; shifted; unexpected } -> _

